import useState, { Component } from "react";
function App() {
  const [count, setCount] = useState(0);

  function countUp() {
    setCount(count + 1);
  }

  return (
    <div>
      <h2>Hello</h2>
      <p>Count is {count}</p>
      <button onClick={countUp}>click</button>
    </div>
  );
}

export default App;
